function LeftPanel(){
    return(
        <article className='LeftPanel'>
           <h2>W naszej ofercie znajdują się języki takie jak:</h2>
           <ul>
            <li>Angielski</li>
            <li>Francuski</li>
            <li>Niemiecki</li>
            <li>Rosyjski</li>
            <li>Hiszpański</li>
           </ul>
        </article>
    );
}

export default LeftPanel;
